import { useState, useEffect } from 'react'
import { API_BASE_URL } from './constans/api'
import Header from './layout/Header'
import Download from './layout/Download'
import Warranty from './layout/Warranty'
import Care from './layout/Care'
import Cashback from './layout/Cashback'
import Clients from './layout/Clients'
import Footer from './layout/Footer'
import Modal from './layout/Modal'

const App = () => {
  const [data, setData] = useState({})

  useEffect(() => {
    fetch(`${API_BASE_URL}.json`)
      .then(response => {
        if (response.ok) {
          return response.json()
        }
      })
      .then(data => setData(data))
      .catch(error => console.error(error))
  }, [])

  return (
    <>    
      {data.header && (
        <Header 
          className={data.header.name}
          data={data.header}
          clients={data.clients}
        />
      )}
      {data.download && (
        <Download
          className={download.name}
          data={download}
        />
      )}
      {warranty && (
        <Warranty
          className={warranty.name}
          data={warranty}
        />
      )}
      {care && (
        <Care
          className={care.name}
          data={care}
        />
      )}
      {cashback && (
        <Cashback 
          className={cashback.name} 
          data={cashback}
        />
      )}
      {clients && (
        <Clients
          className={clients.name}
          data={clients}
        />
      )}
      {footer && (
        <Footer
          className={footer.name}
          data={footer}
        />
      )}
      {modal && (
        <Modal
          className={modal.name}
          data={modal}
        />
      )}
    </>
  )
}

export default App
